window.bookSummaryJSON = "<p>My female matches two Vetusians: me, and the warrior she just killed.</p> <p>Fate is unpredictable. One moment I lose my destined female. The very next, I walk in on the kill of the other male who intended to claim her. For the Empire, the punishment for murder is death; her execution inevitable.</p> <p>Until I steal Katie and her daughter away to Odheim. A planet where all the ugliness of the universe comes together, including the darkest memories of my past.</p> <p>I’m a sgu’dal, an ex-addict.</p> <p>The shame of the healer stratum.</p> <p>But unsuitable, I am not, and now is the time for me to prove it. I will protect Katie and Grace from the grim reaches of injustice, even if it means I have to redefine the meaning of fate.</p> <p><i>Matched</i> is the second book in this interconnected romance series, taking us beyond the borders of Garrison Earth. If you enjoy resilient women, devoted aliens, fated mates, and hard-earned happily ever after’s with no cliffhangers, you’ll love Garrison Earth.</p> <p><i>Author Note:</i> The entire Garrison Earth series touches on subjects such as captivity, drug abuse, forced prostitution, loss of loved ones, human trafficking, rough handling, and violence. Any listener uncomfortable with the harsh realities of an alien invasion should please consider before purchase.</p>"; 
